import React from "react";

const Home = () => {
  return (
    <div className="center-align" style={{ marginTop: "200px" }}>
      <h3>Welcome</h3>
      <p>Personal Profile Management Tool</p>
    </div>
  );
};

export default {
  component: Home
};
